@Override
public Object clone() {
  // Shallow clone is the only thing that's possible, since parameters like
  // analyzer, index commit etc. do not implemnt Cloneable.
  try {
    return super.clone();
  } catch (CloneNotSupportedException e) {
    // should not happen
    throw new RuntimeException(e);
  }
}

